import Footer from '../components/Footer';

import '../assets/css/main.css';

export default function Home() {
  return (
    <div className={styles.container}>
      <main className={styles.main}></main>

      <footer className={styles.footer}>
        <Footer />
      </footer>
    </div>
  );
}
